import {CHANGE_BG, CHANGE_SECONDARY_BG} from './bg.actionType'

let changeBG = () =>{
    return {
        type: CHANGE_BG,
        payload: "change background"
    }
}

let changeSecondaryBG = () =>{
    return {
        type: CHANGE_SECONDARY_BG,
        payload: "reset background"
    }
}

export {changeBG,changeSecondaryBG}
